import React, { useEffect } from 'react';
import styled from 'styled-components';

const Index = () => {
    return (
        <BackGround>
            <HeaderBox>
                <Slogan>회원가입</Slogan>
                <img src="/static/professional_chef.png"
                srcSet="/static/professional_chef@2x.png 2x,
                /static/professional_chef@3x.png 3x"
                className="professional_chef">
                </img>
            </HeaderBox>
            <ContentBox>
                <ContentTitle>My Private Chef</ContentTitle>
                <ContentSubtitle>셰프의 요리가 우리 집으로!</ContentSubtitle>
            </ContentBox>
            
        </BackGround>

    )
}

export default Index;


const BackGround = styled.div`
    width: 100vw;
    height: 100vh;
    background-color: #ffffff;
    display: flex;
`
const HeaderBox = styled.div`
    position: relative;
    width: 100vw;
    height: 52px;
    box-shadow: 0 1px 2px 0
        rgba(0, 0, 0, 0.16);
    background-color: #ffffff;
    .professional_chef {
        position: absolute;
        top: 52px;
        width: 100vw;
        height: auto;
        object-fit: contain;
      }
`
const Slogan = styled.div`
    position: absolute;
    top: 17px;
    left: 50%;
    transform:translate(-50%,0%);
    width: 100px;
    height: 19px;
    font-family: NotoSansCJKKR;
    font-size: 16px;
    font-weight: normal;
    font-stretch: normal;
    font-style: normal;
    line-height: 0.75;
    letter-spacing: normal;
    text-align: center;
    color: #2b2d30;
`
const ContentBox=styled.div`
      position: relative;
`
const ContentTitle=styled.div`
    position: absolute;
    top: 281px;
    left: 50%;
    transform:translate(-50%,0%);
    width: 300px;
    height: 39px;
    font-family: Dynalight;
    font-size: 32px;
    font-weight: normal;
    font-stretch: normal;
    font-style: normal;
    line-height: 1.22;
    letter-spacing: normal;
    text-align: center;
    color: #003a2b;
`
const ContentSubtitle=styled.div`
    position: absolute;
    top: 327px;
    left: 50%;
    transform:translate(-50%,0%);
    width: 200px;
    height: 15px;
     font-family: NotoSansCJKKR;
    font-size: 12px;
     font-weight: normal;
     font-stretch: normal;
     font-style: normal;
     line-height: 1.17;
     letter-spacing: normal;
     text-align: center;
     color: #003a2b;
`
